import React from 'react';
import './Todocontainer.css';
import Todo from './Todo';

function Todocontainer({todos}) {
  return (
   <div className='todo-container'>
   {todos.map((todo,index)=>{
    return(
      <Todo key={index} todo={todo}/>
    )
   })}
</div>
)
}

export default Todocontainer
